const ProgressBar = ({ book }) => {
    return (
        <li 
            key={book.id}
            className="flex hover:cursor-pointer"
        >
            <div className={`h-2 w-36 bg-indigo-100`}>
                <div  className={`h-2 w-24 bg-indigo-500`}></div>
            </div>
        </li>
    );
};

export default ProgressBar;
